import React from "react";
import Checkbox from '@material-ui/core/Checkbox';

class Row extends React.Component {

    render() {
        return (
            <div style={{
                display:"flex"
            }}>
                <Checkbox></Checkbox>
                <h2>This is the message</h2>
            </div>
        )
    }

}

export default Row;
